import React from 'react';
import userData from './data.json';

const Dashboard = () => {
  const { user } = userData;

  return (
    <div>
      <h1>Mobile Plan Dashboard</h1>
      <div>
        <h2>Welcome, {user.name}</h2>
        <p>Your Plan: {user.plan}</p>
        <p>Data Used: {user.dataUsed} of {user.dataLimit}</p>
        <p>Billing Cycle: {user.billingCycle}</p>
        <p>Monthly Cost: {user.monthlyCost}</p>
      </div>
    </div>
  );
};

export default Dashboard;
